import React from 'react';
import Particles from 'react-particles-js';
import './MeApp.css';

const particlesOptions = {
    particles: {
        number: {
            value: 30,
            density: {
                enable: true,
                value_area: 125
            }
        }
    }
}

class MeApp extends React.Component {
    render () {
        return (
            <div>
                <Particles className='particles' params={particlesOptions} />
                <h1 className='my-name' style={{ fontSize: "75px", padding: "50px 20px", textAlign: "center", color: "white"}}>Christopher Nicholas Reeves</h1>
            </div>
        )
    }
}

export default MeApp;
